import React from 'react';
import styles from './Footer.module.css';

const Footer = () => {
  return (
    <footer className={styles.footerContainer}>
      <p>&copy; 2024 UWCompass by Jason Hon. All rights reserved.</p>
    </footer>
  );
};

export default Footer;
